sql:
SELECT T2.`Total` FROM (
    SELECT `Rank by average`, `Couple` FROM (
        SELECT `Rank by average`, `Couple`, ROW_NUMBER() OVER (ORDER BY `Average` DESC) AS rank_num FROM table_1_1354805_6
    ) WHERE rank_num = 2
) AS T1 JOIN table_1_1354805_6 AS T2 ON T1.`Couple` = T2.`Couple`;

actual_sql:
SELECT T2.col3 FROM (
    SELECT col0, col2 FROM (
        SELECT col0, col2, ROW_NUMBER() OVER (ORDER BY col5 DESC) AS rank_num FROM table_1_1354805_6
    ) WHERE rank_num = 2
) AS T1 JOIN table_1_1354805_6 AS T2 ON T1.col2 = T2.col2;

